import React from "react";

const ListItems = ({studentId,firstname,lastname,key}) => {
  return (
    <div className="list-students-body">
      <div className="list-students-item" key={key}>
        <li className="student-id">{studentId}</li>
        <li className="student-name">{firstname}</li>
        <li>{lastname}</li>
      </div>
      <div className="list-button-container">
        <button>
          <i class="fa-regular fa-pen-to-square"></i>
        </button>
        <button>
          <i class="fa-solid fa-trash"></i>
        </button>
      </div>
    </div>
  );
};

export default ListItems;
